const TodoList = (todolist, title) => {
  return (
    <div className="todo-list">
      {todolist.map((todo) => (
        <div className="todo-preview" key={todolist.id}>
          <h2>{todo.title}</h2>
        </div>
      ))}
    </div>
  );
};

export default TodoList;
